import React from 'react';
import { Col, Row, Layout } from 'antd';
import Navbar from '../components/Navbar';
import FooterComponent from '../components/footer';
import { Link } from 'react-router-dom';

import reciboimg from '../img/recibo3.png'; // Importación de la imagen

const { Content } = Layout;

function Recibo() {
  return (
    <Layout className="background">
      <Navbar />
      <Content style={{ padding: '50px 50px', textAlign: 'center' }}>
        <Row justify="center">
          <Col xs={24}>
            <img src={reciboimg} alt="Recibo" style={{ maxWidth: '100%', height: 'auto' }} /> {/* Usando la imagen importada */}
            <div style={{ marginTop: '20px' }}>
              <Link to="/cartelera">
                <button 
                  style={{ 
                    padding: '10px 20px', 
                    backgroundColor: '#242424', 
                    color: '#fff', 
                    border: 'none', 
                    borderRadius: '4px' 
                  }}
                >
                  Volver
                </button>
              </Link>
            </div>
          </Col>
        </Row>
      </Content>
      <FooterComponent />
    </Layout>
  );
}

export default Recibo;
